import React, { useState, useEffect } from "react";


export default function Veiculos(){ 
    const [carros, setCarros] = useState([]);


    const getApiData = async () => {
        const res = await fetch("http://127.0.0.1:5000/api/tasks", {
            mode: "no-cors",
        }).then((res) => res.json());



        setCarros(res)
    }

    useEffect(() => {
        getApiData();
    }, []);


    return ('teste')
}
